window.bookSummaryJSON = "<p><b>In&nbsp;</b><b><i>Prince of Kragdon-ah</i></b><b>, Alex Hawk and the intrepid crew of&nbsp;</b><b><i>The Senta-eh</i></b><b>&nbsp;sailed into a mysterious fog. When they emerged, some of the crew was missing or dead, two strangers were on board, and they were all nearly starved. The only two people who knew what had happened in the fog were not talking.</b></p> <p><i>Mists of Kragdon-ah</i>&nbsp;tells the story of what happened to Alex, Monda-ak, Amy, and Sanda, and everyone aboard&nbsp;<i>The Senta-eh</i>&nbsp;inside the fog. Mysterious airships, strange creatures never seen on Earth, and dangerous quests will keep you on the edge of your seat.</p> <p><i>Includes a special note from the author. </i></p>"; 
